The cute and colourful birds are walking in a trance to their doom and only you can stop their untimely end by shooting birds of the same colour into groups which snaps them out of their trance and let's them fly away to safety. With over 50 engaging levels, a multitude of bonuses to make saving the birds a breeze and 5 distinct game modes.

Features:

    Battle your way through a whopping 50 levels of avian arcade adventure!
    Pit your wits against 5 distinct game modes.
    Use the myriad bonuses wisely to clear the levels quickly.

